import React from "react";
import {MDBBtn,MDBTable,MDBTableBody,} from "mdb-react-ui-kit";
import { useState } from "react";
import {FINISHTODO} from '../Redux/Action/action'
import { useDispatch } from "react-redux";
import { DELETETASK } from "../Redux/Action/actiontype";

const Filter = (props) => {
  let i=0
  let y=0

const dispatch=useDispatch()
const finishtask=()=>{
  dispatch(FINISHTODO())
}
const removetask=()=>{
  dispatch(DELETETASK)
}
   
    return (
      <>
      { props.searchfilter === "Done" ? props.todos
      .filter((todo) => {
        return todo.isDone === true ;
      })
      .map((todo) => (  
                         <MDBTable className="mb-4">
                         <MDBTableBody>
                          <tbody>
                            
                          </tbody>
      <tr>
        <th scope="row"  >{i+1}</th>
        <td  >{todo.description}</td>
        <td  >Complete</td>
        <td>
          <MDBBtn type="submit" color="danger" onClick={removetask}>
            Delete
          </MDBBtn>

        </td>
      </tr>
                                 </MDBTableBody>
                         
                         </MDBTable>
                         
                      )
                    )

                    : props.searchfilter === "Not-Yet" ? props.todos
      .filter((todo) => {
        return todo.isDone === false;
      })
      .map((todo) => (
  <MDBTable className="mb-4">
  <MDBTableBody>
      <tr>
        <th scope="row">{i+1}</th>
        <td>{todo.description}</td>
        <td>{todo.isDone===false?'In progress':'Complete'}</td>
        <td>
          <MDBBtn type="submit" color="danger">
            Delete
          </MDBBtn>
          <MDBBtn type="submit" color="success" className="ms-1"  onClick={finishtask} >
            Finished
          </MDBBtn>

        </td>
      </tr>
                                 </MDBTableBody>
                         
                         </MDBTable>
      ))

      
      : props.todos.map((todo) => (
        <MDBTable className="mb-4">
        <MDBTableBody>
<tr>
<th scope="row">{i+1}</th>
<td>{todo.description}</td>
<td>{todo.isDone===true ? "Complete":"In progress"}</td>
<td>
{}
</td>
</tr>
        </MDBTableBody>

        </MDBTable>

             ))

             }
             </>
           );


}
         
export default Filter ;
